script: |
  super -f text -I q10335.spq | sort > q10335.out

inputs:
  - name: q10335.spq
    data: |
      SELECT DISTINCT ( + - ( + col0 ) ) + - 80 AS col2, - 14 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q10335.out
    data: |
      -167	-14
      -177	-14
      -95	-14
